305	63	\N	Har du haft eget ansvar för en hund tidigare?	Hunderfarenhet	Rasen stämmer med vad du angivit	one	1-haft-hund	1-haft-hund	\N		0	default	t	\N		\N	2017-04-28 09:47:10.892653	2018-11-16 17:16:26.369423	\N	dfc77f37-a0c1-41c6-aabb-2acad98ee527	t	f				f	Många av våra hundraser kräver en hundägare som är kunnig och har hunderfarenhet för att hundinnehavet skall ha bästa förutsättning.	\N
306	64	\N	Vilken åldersgrupp tillhör hundägaren?	Hundägarens ålder	Rasen stämmer med vad du angivit	one	2-hundägare-ålder	2-hundägare-ålder	\N		1	default	t	\N		\N	2017-04-28 09:47:10.918822	2018-11-16 17:16:26.369423	\N	3bcd3f2b-eff4-420e-bf95-5c2b6a3abbc2	t	f				f	Människors ålder ger, oftast, en vink om livserfarenhet och ens förmåga till att ta ansvar och hantera sin vardag med framförhållning. Människans ålder skvallrar också, oftast, om psykisk mognad och eller fysisk ork.	\N
307	65	\N	Vilken åldersgrupp tillhör de yngsta av era barn och eller ofta besökande barn eller barnbarn?	Barnens ålder	Rasen stämmer med vad du angivit	one	3-yngsta-besökande-barn	3-yngsta-besökande-barn	\N		2	default	t	\N		\N	2017-04-28 09:47:10.940477	2018-11-16 17:16:26.369423	\N	99830d02-23a6-402d-859d-2187305d6541	t	f				f	Barn tar mycket tid, speciellt i en viss ålder. Det ger oss vuxna mindre utrymme att hinna med att även sköta och fostra en hund. Vissa raser är också direkt olämpliga att blanda samman med barn i vissa åldrar.<br /><br />Hundens storlek, dess mentalitet, kraven på pälsvård och fostran samt dess utvecklingsstadium med mera kan ge er mer bekymmer än glädje om ni väljer fel ras i detta skede av ert liv.	Notera att om du väljer "0-6 år" ovan så kommer ganska många hundraser försvinna från sökningen. Detta beror inte på att raserna inte fungerar ihop med barn, utan istället på att raserna är krävande. Eftersom både barn och krävande valpar tar mycket tid så är det svårt att kombinera vissa raser med små barn. Om du vet med dig att du har tid och energi nog att hantera båda kan du dock bortse ifrån att systemet säger att vissa raser inte passar.
308	66	\N	Vilken funktion ska hunden fylla i ditt liv?	Hundens funktion	Rasen stämmer med vad du angivit	one	4-funktion	4-funktion	\N		3	default	t	\N		\N	2017-04-28 09:47:10.958091	2018-11-16 17:16:26.369423	\N	8e7df994-c3be-47f6-80ab-54679106da2d	t	f				f	När du vill ”bli med hund” är det viktigt att du tänker igenom hur ni tillsammans skall leva. Vill du bli svensk mästare inom någon hundsport eller skall din hund hjälpa dig med jakt? Du har kanske tänkt dig din hund som sällskap och livskamrat?<br />Alla hundraser har ”skapats” för en arbetsuppgift som har präglat hundens intresse och ointresse. Dessa egenskaper ändras inte nämnvärt på även om du inte tänker använda den specifika egenskapen hos din hund.	\N
309	67	\N	Hur mycket tid per vecka vill du ägna åt pälsvård?	Pälsvård	Rasen stämmer med vad du angivit	one	6-vecko-pälsvård-tid	6-vecko-pälsvård-tid	\N		5	default	t	\N		\N	2017-04-28 09:47:10.976778	2018-11-16 17:16:26.369423	\N	a5c38f93-0057-4c95-8e76-2b673b663d0d	t	f				f	Vissa pälsar tar enormt mycket tid för att hållas i god kondition, året om. Utöver borstning, kamning och bad skall många pälsar klippas, strippas eller trimmas. Tänk på att du dessutom varje vecka bör sköta om hundens tänder, klor och öron. En hund med krävande päls tar mycket tid i anspråk.	\N
310	68	\N	Hur stor hund vill du ha?	Hundens storlek	Rasen stämmer med vad du angivit	any	7-storlek	7-storlek	\N		6	default	t	\N		\N	2017-04-28 09:47:10.995725	2018-11-16 17:16:26.369423	\N	ded3cd34-63ce-4f23-8fdb-e078dae5eda6	t	f				f	Alla valpar är behändiga, men inom ett år har de flesta hundar nått sin maxhöjd. Då om inte tidigare kanske man inser att bilen/hemmet känns mycket trängre eller att ens liv blivit besvärligare för att omgivningen inte uppskattar hundens storlek. Tänk efter framåt innan du väljer storlek på hund.	\N
311	69	\N	Hur mycket tid per dag, utöver 'rastningsrundor', vill eller kan du vara ute med din hund?	Promenader/motion	Rasen stämmer med vad du angivit	one	8-ute-tid-per-dag	8-tid-per-dag	\N		7	default	t	\N		\N	2017-04-28 09:47:11.016843	2018-11-16 17:16:26.369423	\N	2f82a2d1-3c7e-4f04-89a8-5c890a661877	t	f				f	För att hundar skall må bra och utvecklas till harmoniska individer behöver de få komma ut tillsammans med dig och upptäcka nya saker, umgås med andra och få göra av med energi. Olika hundraser och olika individer har olika behov av energireduktion.	\N
312	66	\N	Vilken uppgift vill du att din hund ska hjälpa till med?	Tjänstehund	Rasen stämmer med vad du angivit	one	5-funktion-jakt	5-funktion-jakt	\N		4	default	f	\N		\N	2017-04-28 09:47:11.023087	2018-11-16 17:16:26.369423	\N	ca4211ab-4225-4cad-b2b1-2210fe31b584	t	f				f	Här har jag räknat upp några av de arbetsuppgifter många av våra hundar använts till och som har präglat dem. Läs extra noga om din tänkta ras i någon rasbok, så att rätt hund används till rätt arbetsområde och eller viltslag.<br />Med assistanshund menas hundar som är behjälpliga till människor med handikapp, där hunden till exempel hjälper till att öppna dörrar och lådor, trycker på knappar och så vidare. Dessa hundar kallas för SOS-hundar och vissa av dem kan också vara lämpliga som arbetande sällskapshundar i exempelvis (åldrings) vården.\\nVakt innefattar inte bara att kunna fysiskt försvara utan även att var uppmärksam och att alarmera närmande mot flocken.\\nTill klövvilt räknas även vildsvin, var extra noga när du väljer hund för denna jakt. Välj ingen hund som är för på/stridbar – det lär bara skada hunden.	\N
